(1, 1, 'ar', 'New User', '<p>,</p>\n                    <p>   { app_name }.</p>\n                    <p>..   </p>\n                    <p>  : { mail }   : { password }</p>\n                    <p>{ app_url }</p>\n                    <p></p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
