(48, 3, 'pt-br', 'New Payroll', '<p>Assunto:-Departamento de RH / Empresa para enviar payslips por e-mail no momento da confirma&ccedil;&atilde;o do payslip</p>\n                    <p>Oi {name},</p>\n                    <p>Espero que este e-mail encontre voc&ecirc; bem! Por favor, consulte o payslip anexado por {salary_month}.</p>\n                    <p>basta clicar no bot&atilde;o abaixo</p>\n                    <p>Payslip</p>\n                    <p>Sinta-se &agrave; vontade para alcan&ccedil;ar fora se voc&ecirc; tiver alguma d&uacute;vida.</p>\n                    <p>Obrigado</p>\n                    <p>Considera,</p>\n                    <p>Departamento de RH,</p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(49, 4, 'ar', 'New Ticket', '<p>Subject : -HR  /   ticket   { ticket_title }</p>\n                    <p> { ticket_name }</p>\n                    <p>        !       { ticket_code }.</p>\n                    <p>{ ticket_description } </p>\n                    <p>        .</p>\n                    <p> </p>\n                    <p>Regards,</p>\n                    <p>   </p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(50, 4, 'da', 'New Ticket', '<p>Emne:-HR-afdeling / Kompagni til at sende ticket for { ticket_title }</p>\n                    <p>Hej { ticket_name },</p>\n                    <p>H&aring;ber denne e-mail finder dig godt, din ticket-kode er { ticket_code }.</p>\n                    <p>{ ticket_description },</p>\n                    <p>Du er velkommen til at r&aelig;kke ud, hvis du har nogen sp&oslash;rgsm&aring;l.</p>\n                    <p>Tak.</p>\n                    <p>Med venlig hilsen</p>\n                    <p>HR-afdelingen,</p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(51, 4, 'de', 'New Ticket', '<p>Betreff: -Personalabteilung/Firma zum Senden von Ticket f&uuml;r {ticket_title}</p>\n                    <p>Hi {ticket_name},</p>\n                    <p>Hoffen Sie, diese E-Mail findet Sie gut!, Ihr Ticketcode ist {ticket_code}.</p>\n                    <p>{ticket_description},</p>\n                    <p>F&uuml;hlen Sie sich frei, wenn Sie Fragen haben.</p>\n                    <p>Danke.</p>\n                    <p>Betrachtet,</p>\n                    <p>Personalabteilung,</p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(52, 4, 'en', 'New Ticket', '<p ><b>Subject:-HR department/Company to send ticket for {ticket_title}</b></p>\n                    <p ><b>Hi {ticket_name},</b></p>\n                    <p >Hope this email nds you well! , Your ticket code is {ticket_code}. </p></br>\n                    {ticket_description},\n                    <p >Feel free to reach out if you have any questions.</p></br>\n                    <p><b>Thank you</b></p>\n                    <p><b>Regards,</b></p>\n                    <p><b>HR Department,</b></p>\n                    <p><b>{app_name}</b></p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(53, 4, 'es', 'New Ticket', '<p>Asunto: -Departamento de RR.HH./Empresa para enviar el ticket de {ticket_title}</p>\n                    <p>Hi {ticket_name},</p>\n                    <p>&iexcl;Espero que este correo electr&oacute;nico te encuentre bien!, Tu c&oacute;digo de entrada es {ticket_code}.</p>\n                    <p>{ticket_description},</p>\n                    <p>Si&eacute;ntase libre de llegar si usted tiene alguna pregunta.</p>\n                    <p>&iexcl;Gracias!</p>\n                    <p>Considerando,</p>\n                    <p>Departamento de Recursos Humanos,</p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(54, 4, 'fr', 'New Ticket', '<p>Objet: -HR department / Company to send ticket for { ticket_title }</p>\n                    <p>Hi { ticket_name },</p>\n                    <p>Hope this email vous trouve bien !, Votre code de ticket est { ticket_code }.</p>\n                    <p>{ ticket_description },</p>\n                    <p>Nh&eacute;sitez pas &agrave; nous contacter si vous avez des questions.</p>\n                    <p>Je vous remercie</p>\n                    <p>Regards,</p>\n                    <p>D&eacute;partement des RH,</p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(55, 4, 'it', 'New Ticket', '<p>Oggetto: - Dipartimento HR / Societ&agrave; per inviare ticket per {ticket_title}</p>\n                    <p>Ciao {ticket_name},</p>\n                    <p>Spero che questa email ti trovi bene!, Il tuo codice del biglietto &egrave; {ticket_code}.</p>\n                    <p>{ticket_description},</p>\n                    <p>Sentiti libero di raggiungere se hai domande.</p>\n                    <p>Grazie</p>\n                    <p>Riguardo,</p>\n                    <p>Dipartimento HR,</p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(56, 4, 'ja', 'New Ticket', '<p>:-HR / {ticket_title} </p>\n                    <p> {ticket_name}</p>\n                    <p> E  {ticket_code}</p>\n                    <p>{ticket_description }</p>\n                    <p></p>\n                    <p></p>\n                    <p></p>\n                    <p>HR </p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(57, 4, 'nl', 'New Ticket', '<p>Betreft: -HR-afdeling/Bedrijf voor het verzenden van ticket voor { ticket_title }</p>\n                    <p>Hallo { ticket_name },</p>\n                    <p>Hoop dat deze e-mail u goed vindt!, Uw ticket code is { ticket_code }.</p>\n                    <p>{ ticket_description},</p>\n                    <p>Voel je vrij om uit te reiken als je vragen hebt.</p>\n                    <p>Dank u wel</p>\n                    <p>Betreft:</p>\n                    <p>HR-afdeling,</p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(58, 4, 'pl', 'New Ticket', '<p>Temat:-Dzia HR/Firma do wysyki biletu dla {ticket_title }</p>\n                    <p>Witaj {ticket_name },</p>\n                    <p>Mam nadziej, e ta wiadomo e-mail znajduje si dobrze!, Tw&oacute;j kod zgoszenia to {ticket_code }.</p>\n                    <p>{ticket_description },</p>\n                    <p>Czuj si swobodnie, jeli masz jakie pytania.</p>\n                    <p>Dzikujemy</p>\n                    <p>W odniesieniu do</p>\n                    <p>Dzia HR,</p>\n                    <p>{app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(59, 4, 'ru', 'New Ticket', '<p>: -HR /     { ticket_title }</p>\n                    <p>Hi { ticket_name },</p>\n                    <p>,      !,   -{ ticket_code }.</p>\n                    <p>{ ticket_description },</p>\n                    <p> ,     .</p>\n                    <p>.</p>\n                    <p> ,</p>\n                    <p> ,</p>\n                    <p>{ app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(60, 4, 'pt', 'New Ticket', '<p>Assunto:-Departamento de RH / Empresa para enviar ingresso para {ticket_title}</p>\n                    <p>Oi {ticket_name},</p>\n                    <p>Espero que este e-mail te encontre bem!, Seu c&oacute;digo de bilhete &eacute; {ticket_code}.</p>\n                    <p>{ticket_description},</p>\n                    <p>Sinta-se &agrave; vontade para alcan&ccedil;ar fora se voc&ecirc; tiver alguma d&uacute;vida.</p>\n                    <p>Obrigado</p>\n                    <p>Considera,</p>\n                    <p>Departamento de RH,</p>\n                    <p>{app_name}</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(61, 4, 'tr', 'New Ticket', '<p ><b>Konu:-Bilet gnderilecek K departman/irket {ticket_title}</b></p>\n                    <p ><b>MERHABA {ticket_name},</b></p>\n                    <p >Umarm bu e-posta sizi iyi bulur! , Bilet kodunuz {ticket_code}. </p></br>\n                    {ticket_description},\n                    <p >Herhangi bir sorunuz varsa ekinmeden bize ulan.</p></br>\n                    <p><b>Teekkr ederim</b></p>\n                    <p><b>Sayglarmzla,</b></p>\n                    <p><b>K Departman,</b></p>\n                    <p><b>{app_name}</b></p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
(62, 4, 'zh', 'New Ticket', '<p ><b>-/ {ticket_title}</b></p>\n                    <p ><b> {ticket_name},</b></p>\n                    <p > ,  {ticket_code}. </p></br>\n                    {ticket_description},\n                    <p >.</p></br>\n                    <p><b></b></p>\n                    <p><b>,</b></p>\n                    <p><b>,</b></p>\n                    <p><b>{app_name}</b></p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26');
