(170, 11, 'pl', 'Employee Warning', '<p>Temat: -Dzia HR/Firma do wysyania listu ostrzegawczego.</p>\n                    <p>Szanowny {employee_warning_name },</p>\n                    <p>{warning_subject }</p>\n                    <p>{warning_description }</p>\n                    <p>Czuj si swobodnie, jeli masz jakie pytania.</p>\n                    <p>Dzikujemy</p>\n                    <p>W odniesieniu do</p>\n                    <p>Dzia HR,</p>\n                    <p>{app_name }</p>', '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
