(14, 'tr', '<h3 style=\"text-align: center;\">Katlma Mektubu</h3>\n            <p>{date}</p>\n            <p>{employee_name}</p>\n            <p>{address}</p>\n            <p>Konu: Kadroya randevu {designation}</p>\n            <p>Canm {employee_name},</p>\n            <p>konumunu size sunmaktan mutluluk duyuyoruz {designation} ile {app_name} irket aadaki artlarla ve</p>\n            <p>koullar:</p>\n            <p>1. ie balama</p>\n            <p>e almnz u tarihten itibaren etkili olacaktr {start_date}</p>\n            <p>2.  unvan</p>\n            <p> unvannz olacak{designation}.</p>\n            <p>3. Maa</p>\n            <p>Maanz ve dier menfaatleriniz Programda belirtildii gibi olacaktr 1, buraya.</p>\n            <p>4. Gnderme Yeri</p>\n            <p>adresinde yaynlanacaksnz {branch}. Ancak irketin sahip olduu herhangi bir iyerinde almanz gerekebilir veya</p>\n            <p>daha sonra edinebilir.</p>\n            <p>5. alma saati</p>\n            <p>Normal alma gnleri Pazartesiden Cumaya kadardr. iin gerekli olan saatlerde almanz istenecektir</p>\n            <p>irkete kar grevlerinizi uygun ekilde yerine getirmek. Normal alma saatleri, {start_time} ile {end_time} ve sen</p>\n            <p>daha az almas beklenmiyor {total_hours} her hafta saat ve gerekirse, durumunuza bal olarak ek saatler</p>\n            <p>sorumluluklar.</p>\n            <p>6. zin/Tatiller</p>\n            <p>6.1 12 gn izin hakknz var.</p>\n            <p>6.2 12 i gn cretli hastalk izni hakknz var.</p>\n            <p>6.3 irket, her yln banda ilan edilen tatillerin bir listesini bildirecektir.</p>\n            <p>7. grevlerin nitelii</p>\n            <p>Grevinizin doasnda bulunan tm grevleri ve irket olarak bu tr ek grevleri elinizden gelen en iyi ekilde yerine getireceksiniz</p>\n            <p>zaman zaman performans gstermeniz iin sizi arabilir. zel grevleriniz, burada izelge IIde belirtilmitir.</p>\n            <p>8. irket mlkiyeti</p>\n            <p>Grev sresince resmi kullanm iin size emanet edilmi olabilecek irket mallarn her zaman iyi durumda tutacaksnz</p>\n            <p>istihdamnzdan feragat etmeden nce bu tr tm mlkleri irkete iade edecektir, aksi takdirde maliyet</p>\n            <p>ayn tutar irket tarafndan sizden tahsil edilecektir.</p>\n            <p>9. dn alma/hediye kabul etme</p>\n            <p>Kiisel kazanlarnz iin kendinizden herhangi bir para, hediye, dl veya tazminat dn almayacak veya kabul etmeyeceksiniz</p>\n            <p>resmi ilikiler iinde olabileceiniz herhangi bir kiiye/mteriye kar maddi ykmllk altnda.</p>\n            <p>10. Sonlandrma</p>\n            <p>10.1 Randevunuz irket tarafndan size en az [Bildirim] ay ncesinden bildirimde bulunularak herhangi bir sebep gstermeksizin feshedilebilir</p>\n            <p>yazl bildirim veya bunun yerine maa. Bu maddenin amalar dorultusunda maa, temel maa anlamna gelir.</p>\n            <p>10.2 [alan Bildirimi]nden daha az olmamak kaydyla, irketteki almanz herhangi bir sebep gstermeden feshedebilirsiniz</p>\n            <p>ay nceden ihbar veya kaydedilmemi dnem iin maa, tarih itibariyle bekleyen izinlerin ayarlanmasndan sonra kalan.</p>\n            <p>10.3 irket, herhangi bir ihbar sresi veya fesih demesi olmakszn i akdinizi aniden feshetme hakkn sakl tutar</p>\n            <p>suiistimal veya ihmalden sulu olduunuza veya herhangi bir temel ihlalde bulunduunuza inanmak iin makul bir gerekesi varsa</p>\n            <p>szlemeye veya irkete herhangi bir zarara neden oldu.</p>\n            <p>10. 4 Herhangi bir nedenle iinize son verildiinde, tm mal varlnz irkete iade edeceksiniz; belgeler ve</p>\n            <p>tm numuneler, literatr, szlemeler, kaytlar, listeler, izimler, planlar dahil olmak zere kat, hem orijinali hem de kopyalar,</p>\n            <p>mektuplar, notlar, veriler ve benzerleri; ve Gizli Bilgiler, sizin mlkiyetinizde veya kontrolnz altnda</p>\n            <p>stihdam veya mterilerin i ilikilerine.</p>\n            <p>11. Kesin bilgi</p>\n            <p>11. 1 irkette altnz sre boyunca tm zamannz, dikkatinizi ve becerinizi elinizden gelenin en iyisini yapmaya adayacaksnz</p>\n            <p>onun ii. Dorudan veya dolayl olarak kendinizle iliki kurmamal veya ilikilendirmemeli, bunlarla balant kurmamal, ilgilenmemeli, istihdam edilmemeli veya</p>\n            <p>irketin nceden izni olmakszn herhangi bir eitim kursuna devam etmeyin veya herhangi bir kursa devam etmeyin</p>\n            <p>faaliyetleri veya dier herhangi bir grev veya yar zamanl alma veya nceden izin almakszn herhangi bir eitim kursuna devam etme</p>\n            <p>irket.</p>\n            <p>11.2 Her zaman en yksek derecede gizlilii korumal ve kaytlar, belgeleri ve dier bilgileri gizli tutmalsnz.</p>\n            <p>Sizin tarafnzdan bilinebilecek veya herhangi bir ekilde size gvenilebilecek irketin ileriyle ilgili Gizli Bilgiler</p>\n            <p>ve bu tr kaytlar, belgeleri ve bilgileri yalnzca usulne uygun olarak irketin karlar dorultusunda kullanacaksnz. in</p>\n            <p>bu maddenin amalar Gizli Bilgiler, irketin ve mterilerinin ileri hakknda bilgi anlamna gelir</p>\n            <p>halka ak olmayan ve istihdamnz srasnda sizin tarafnzdan renilebilecek olan. Bu ierir,</p>\n            <p>ancak bunlarla snrl olmamak zere, kurulua ilikin bilgiler, mteri listeleri, istihdam politikalar, personel ve bilgiler</p>\n            <p>fikirler, kavramlar, projeksiyonlar, teknoloji, klavuzlar, izimler, tasarmlar dahil olmak zere irketin rnleri, sreleri hakknda,</p>\n            <p>spesifikasyonlar ve bu tr Gizli Bilgileri ieren tm belgeler, zgemiler, kaytlar ve dier belgeler.</p>\n            <p>11.3 Gizli Bilgileri hibir zaman izinsiz olarak ofisten karmayacak msnz?.</p>\n            <p>11.4 Koruma ve aklamama greviniz</p>\n            <p>e Gizli Bilgiler, bu Szlemenin sona ermesinden veya feshedilmesinden ve/veya irketteki istihdamnzdan sonra da geerliliini koruyacaktr.</p>\n            <p>11.5 Bu maddenin koullarnn ihlali, sizi herhangi bir ek olarak yukardaki madde uyarnca derhal iten karmaya ykml klacaktr</p>\n            <p>irketin kanunen size kar sahip olabilecei dier areler.</p>\n            <p>12. Bildirimler</p>\n            <p>Tebligatlar tarafnzca irket in kaytl ofis adresine gnderilebilir. Bildirimler irket tarafndan size u adreste verilebilir</p>\n            <p>tResmi kaytlarda sizin tarafnzdan bildirilen adres.</p>\n            <p>13. irket Politikasnn Uygulanabilirlii</p>\n            <p>irket, izin hakk, analk gibi konularda zaman zaman polie beyan yapmaya yetkilidir</p>\n            <p>izinler, alanlara salanan faydalar, alma saatleri, transfer politikalar vb. ve tamamen kendi takdirine bal olarak zaman zaman deitirebilir.</p>\n            <p>irketin tm bu tr politika kararlar sizin iin balayc olacak ve bu Szlemeyi o lde geersiz klacaktr.</p>\n            <p>14. Geerli Yasa/Yarg Yetkisi</p>\n            <p>irkette istihdamnz lke yasalarna tabidir. Tm ihtilaflar Yksek Mahkemenin yarg yetkisine tabi olacaktr.</p>\n            <p>sadece Gujarat.</p>\n            <p>15. teklifimizin kabul</p>\n            <p>Ltfen bu  Szlemesini kabul ettiinizi imzalayarak ve kopya kopyay geri gndererek onaylayn.</p>\n            <p>Size ho geldiniz diyor ve kabulnz almay ve sizinle almay sabrszlkla bekliyoruz.</p>\n            <p>Sayglarmla,</p>\n            <p>{app_name}</p>\n            <p>{date}</p>', 1, '2024-05-24 21:24:26', '2024-05-24 21:24:26'),
