(45, 'testimonials_long_description', 'WorkDo seCommerce package offers you a sales-ready.secure online store. The package puts all the key pieces together, from design to payment processing. This gives you a headstart in your eCommerce venture. Every store is built using a reliable PHP framework -laravel. Thisspeeds up the development process while increasing the stores security and performance.Additionally, thanks to the accompanying mobile app, you and your team can manage the store on the go. Whats more, because the app works both for you and your customers, you can use it to reach a wider audience.And, unlike popular eCommerce platforms, it doesnt bind you to any terms and conditions or recurring fees. You get to choose where you host it or which payment gateway you use. Lastly, you getcomplete control over the looks of the store. And if it lacks any functionalities that you need, just reach out, and lets discuss customization possibilities', '2024-05-24 21:24:24', '2024-05-24 21:24:24'),
