INSERT INTO `template` (`id`, `template_name`, `prompt`, `module`, `field_json`, `is_tone`, `created_at`, `updated_at`) VALUES
(1, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'allowance', '{\"field\":[{\"label\":\"Allowance Title\",\"placeholder\":\"e.g.Medical Allowance, Bonus Allowance\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(2, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'commission', '{\"field\":[{\"label\":\"Commission Title\",\"placeholder\":\"e.g.Sales Commission, Bonus Commission\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(3, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'loan', '{\"field\":[{\"label\":\"Loan Title\",\"placeholder\":\"e.g.Sales Training Loan, Other Loan\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(4, 'reason', 'Generate a comma-separated string of common loan reasons that employees may provide to their employers. Include both personal and professional reasons for taking loan, such only ##reason## . Aim to generate a diverse range of loan reasons that can be used in different situations. Please provide a comprehensive and varied list of loan reasons that can help employers understand and accommodate their employees\' needs.', 'loan', '{\"field\":[{\"label\":\"Leave Reason\",\"placeholder\":\"e.g.career development,health issues\",\"field_type\":\"textarea\",\"field_name\":\"reason\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(5, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'saturation deduction', '{\"field\":[{\"label\":\"Saturation Deduction Title\",\"placeholder\":\"e.g.Saturation Deduction\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(6, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'other payment', '{\"field\":[{\"label\":\"Other Payment Title\",\"placeholder\":\"e.g.Bonus Payment, Allowance Payment\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(7, 'title', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##title## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'overtime', '{\"field\":[{\"label\":\"Overtime Title\",\"placeholder\":\"e.g.Overtime Pay, Overtime Earnings\",\"field_type\":\"text_box\",\"field_name\":\"title\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(8, 'remark', 'Generate a comma-separated string of common loan reasons that employees may provide to their employers. Include both personal and professional reasons for taking loan, such only ##remark## . Aim to generate a diverse range of loan reasons that can be used in different situations. Please provide a comprehensive and varied list of loan reasons that can help employers understand and accommodate their employees\' needs.', 'timesheet', '{\"field\":[{\"label\":\"Timesheet Remark\",\"placeholder\":\"e.g.Project Update,Time Management\",\"field_type\":\"textarea\",\"field_name\":\"reason\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(9, 'leave_reason', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##leave_reason## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'leave', '{\"field\":[{\"label\":\"Leave Type\",\"placeholder\":\"e.g.illness, family emergencies,vacation\",\"field_type\":\"textarea\",\"field_name\":\"leave_reason\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(10, 'remark', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##remark## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'leave', '{\"field\":[{\"label\":\"Leave Remark\",\"placeholder\":\"e.g.illness, family emergencies,vacation\",\"field_type\":\"textarea\",\"field_name\":\"remark\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(11, 'remark', 'Generate a comma-separated string of common leave reasons that employees may provide to their employers. Include both personal and professional reasons for taking leave, such only ##remark## . Aim to generate a diverse range of leave reasons that can be used in different situations. Please provide a comprehensive and varied list of leave reasons that can help employers understand and accommodate their employees\' needs.', 'appraisal', '{\"field\":[{\"label\":\"Appraisal Remark\",\"placeholder\":\"e.g.Communication Skills, Teamwork\",\"field_type\":\"textarea\",\"field_name\":\"remark\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(12, 'subject', 'Generate a goal subject for an employee\'s goal related type to ##type##.', 'goal tracking', '{\"field\":[{\"label\":\"Goal Type\",\"placeholder\":\"e.g.invoice, production,hiring\",\"field_type\":\"text_box\",\"field_name\":\"type\"}]}', 0, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(13, 'description', 'Generate a goal descriptions for an employee\'s goal title is ##title##.', 'goal tracking', '{\"field\":[{\"label\":\"Goal Description\",\"placeholder\":\"e.g.Invoice Accuracy\",\"field_type\":\"textarea\",\"field_name\":\"title\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(14, 'description', 'Generate a deposit descriptions for an employee\'s deposit title is ##title##.', 'deposit', '{\"field\":[{\"label\":\"Deposit Description\",\"placeholder\":\"e.g.Salary Deposit, Bonus Deposit\",\"field_type\":\"textarea\",\"field_name\":\"title\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(15, 'description', 'Generate a expense descriptions for an employee\'s expense title is ##title##.', 'expense', '{\"field\":[{\"label\":\"Expense Description\",\"placeholder\":\"e.g.Office Supplies, Travel Expenses\",\"field_type\":\"textarea\",\"field_name\":\"title\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(16, 'description', 'Generate a transfer balance descriptions for an employee\'s transfer balance title is ##title##.', 'transfer balance', '{\"field\":[{\"label\":\"Transfer Balance Description\",\"placeholder\":\"e.g.Savings Transfer\",\"field_type\":\"textarea\",\"field_name\":\"title\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(17, 'description', 'Generate a job training descriptions for a ##position## position. The training description should include responsibilities such as ##responsibilities##. Please ensure the descriptions are concise, informative, and accurately reflect the key responsibilities of a ##position##.', 'training', '{\"field\":[{\"label\":\"Position\",\"placeholder\":\"job training descriptions\",\"field_type\":\"text_box\",\"field_name\":\"position\"},{\"label\":\"Responsibilities\",\"placeholder\":\"\",\"field_type\":\"textarea\",\"field_name\":\"responsibilities\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(18, 'description', 'Generate a description for presenting the Award. The description should highlight ##description##. Emphasize the significance of the  Award as a symbol of recognition for employee\'s remarkable accomplishments and its representation of her \'##description##\' and impact on the organization. Please create a personalized and engaging description that conveys appreciation, pride, and gratitude for employee\'s contributions to the company\'s sucess', 'award', '{\"field\":[{\"label\":\"Award Description\",\"placeholder\":\"e.g.skilled, focused ,efficiency\",\"field_type\":\"textarea\",\"field_name\":\"description\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(19, 'description', 'Generate a list of common description for employee transfers within an organization. Include description such as ##description##. Please provide a comprehensive and varied list of description that can help employers understand and address employee transfer situations effectively.', 'transfer', '{\"field\":[{\"label\":\"Transfer Description\",\"placeholder\":\"e.g.career development,special projects or initiatives\",\"field_type\":\"textarea\",\"field_name\":\"description\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(20, 'description', 'Generate a description why an employee might choose to resign and request a transfer to another location within the company. Include both professional and personal reasons that could contribute to this decision. Examples may include ##reasons##. Aim to provide a comprehensive and varied description that can help employers understand and accommodate employees\' needs when considering a transfer request', 'resignation', '{\"field\":[{\"label\":\"Resignation reasons\",\"placeholder\":\"e.g.career development,health issues\",\"field_type\":\"textarea\",\"field_name\":\"reasons\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
(21, 'description', 'Generate a description for organizing a company trip. The trip aims to ##aims## . Please provide a diverse description that highlight the benefits and positive outcomes associated with organizing a company trip. Focus on creating an engaging and enjoyable experience for employees while also achieving business objectives and cultivating a positive work environment.', 'travel', '{\"field\":[{\"label\":\"Aims\",\"placeholder\":\"e.g.career development,health issues\",\"field_type\":\"textarea\",\"field_name\":\"aims\"}]}', 1, '2024-05-24 21:24:27', '2024-05-24 21:24:27'),
